import React from "react";
class TodoMain extends React.Component {
    render() {      
        return(
            <div  className="App">
            <div id="container">
                <div id="header">
                    <div id="logo">
                        <h1>Product management</h1>
                    </div>
                    <div id="menu">
                        <ul>
                            <li>Homepage</li>
                            <li>Suppliers</li>
                            <li>Categories</li>
                            <li>Products</li>	
                            <li>Log Out</li>		
                        </ul>
                    </div>
                </div>
                <div id="main">
                    
                </div>
            </div>
            </div>
        );
    }
}

export default TodoMain;
